selector_to_html = {"a[href=\"Level2_anno_epi.html#secretory-ameloblast\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Secretory ameloblast<a class=\"headerlink\" href=\"#secretory-ameloblast\" title=\"Permalink to this heading\">#</a></h2><p>We named this cluster base on the study described in <span id=\"id4\">[<a class=\"reference internal\" href=\"../references.html#id29\" title=\"Florian Hermans, Celine Bueds, Lara Hemeryck, Ivo Lambrichts, Annelies Bronckaers, and Hugo Vankelecom. Establishment of inclusive single-cell transcriptome atlases from mouse and human tooth as powerful resource for dental research. Frontiers in Cell and Developmental Biology, 2022.\">Hermans <em>et al.</em>, 2022</a>]</span>.\n<img alt=\"png\" src=\"../_images/C12-9.png\"/></p>", "a[href=\"Level2_anno_epi.html#mature-ameloblast\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mature ameloblast<a class=\"headerlink\" href=\"#mature-ameloblast\" title=\"Permalink to this heading\">#</a></h2><p>Mature ameloblast markers (<em>Odam</em>, <em>Klk4</em>, <em>Amtn</em> <span id=\"id5\">[<a class=\"reference internal\" href=\"../references.html#id29\" title=\"Florian Hermans, Celine Bueds, Lara Hemeryck, Ivo Lambrichts, Annelies Bronckaers, and Hugo Vankelecom. Establishment of inclusive single-cell transcriptome atlases from mouse and human tooth as powerful resource for dental research. Frontiers in Cell and Developmental Biology, 2022.\">Hermans <em>et al.</em>, 2022</a>]</span>) are expressed in this cluster.\n<img alt=\"png\" src=\"../_images/C12-10.png\"/></p>", "a[href=\"Level1_anno_epi.html#ameloblast-and-non-ameloblast\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ameloblast and Non-ameloblast<a class=\"headerlink\" href=\"#ameloblast-and-non-ameloblast\" title=\"Permalink to this heading\">#</a></h2><p>These clusters can be devided by ameloblast markers <a class=\"reference external\" href=\"https://www.ncbi.nlm.nih.gov/gene/258\"><em>Ambn</em></a>.\n<img alt=\"png\" src=\"img/annotation_epi/Epi-C5.png\"/></p>", "a[href=\"Level2_anno_epi.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Level 2 Annotation<a class=\"headerlink\" href=\"#level-2-annotation\" title=\"Permalink to this heading\">#</a></h1><h2>Dental Epithelial Progenitors<a class=\"headerlink\" href=\"#dental-epithelial-progenitors\" title=\"Permalink to this heading\">#</a></h2><p>This cluster is annotated base on the time point, mainly E12.5-E15.5, with high development potential\n<img alt=\"png\" src=\"../_images/C12-1.png\"/></p>", "a[href=\"Level1_anno_epi.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Level 1 Annotation<a class=\"headerlink\" href=\"#level-1-annotation\" title=\"Permalink to this heading\">#</a></h1><h2>Motivation<a class=\"headerlink\" href=\"#motivation\" title=\"Permalink to this heading\">#</a></h2><p>In level 1 annotation, we devided the epithelium into two major clusters and other low quality clusters. Base on ameloblast markers, these two clusters can be annotated as ameloblasts, Non-ameloblasts.</p>", "a[href=\"#annotation\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Annotation<a class=\"headerlink\" href=\"#annotation\" title=\"Permalink to this heading\">#</a></h1><p>In this section, we will adapt the annotation pipeline from <a class=\"reference external\" href=\"https://github.com/lsteuernagel/scHarmonization/\">scHarmonization</a> <span id=\"id1\">[<a class=\"reference internal\" href=\"../references.html#id22\" title=\"Lukas Steuernagel, Brian Y. H. Lam, Paul Klemm, Georgina K. C. Dowsett, Corinna A. Bauder, John A. Tadross, Tamara Sotelo Hitschfeld, Almudena del Rio Martin, Weiyi Chen, Alain J. de Solis, Henning Fenselau, Peter Davidsen, Irene Cimino, Sara N. Kohnke, Debra Rimmington, Anthony P. Coll, Andreas Beyer, Giles S. H. Yeo, and Jens C. Br\u00fcning. HypoMap\u2014a unified single-cell gene expression atlas of the murine hypothalamus. Nature Metabolism, 4(10):1402\u20131419, October 2022. doi:10.1038/s42255-022-00657-y.\">Steuernagel <em>et al.</em>, 2022</a>]</span> to our data.\nYou can just run this pipeline directly. Here, I just break down the pipeline into several steps for better understanding.</p>", "a[href=\"Level2_anno_epi.html#enamel-organ-layers\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Enamel organ layers<a class=\"headerlink\" href=\"#enamel-organ-layers\" title=\"Permalink to this heading\">#</a></h2><p>These cells are differentiated, expressed the OEE markers (<em>Slco4a1</em>, <em>Th</em>), IEE markers (<em>Thbd</em>, <em>Jph4</em>) and SI markers (<em>Sfrp5</em>) <span id=\"id1\">[<a class=\"reference internal\" href=\"../references.html#id8\" title=\"Jan Krivanek, Ruslan A. Soldatov, Maria Eleni Kastriti, Tatiana Chontorotzea, Anna Nele Herdina, Julian Petersen, Bara Szarowska, Marie Landova, Veronika Kovar Matejova, Lydie Izakovicova Holla, Ulrike Kuchler, Ivana Vidovic Zdrilic, Anushree Vijaykumar, Anamaria Balic, Pauline Marangoni, Ophir D. Klein, Vitor C. M. Neves, Val Yianni, Paul T. Sharpe, Tibor Harkany, Brian D. Metscher, Marc Baj\u00e9noff, Mina Mina, Kaj Fried, Peter V. Kharchenko, and Igor Adameyko. Dental cell type atlas reveals stem and differentiated cell types in mouse and human teeth. Nature Communications, 11(1):4816, September 2020. doi:10.1038/s41467-020-18512-7.\">Krivanek <em>et al.</em>, 2020</a>]</span>.\n<img alt=\"png\" src=\"img/annotation_epi/C12-2_epi.png\"/></p>", "a[href=\"#details-of-each-level-annotation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Details of Each Level Annotation<a class=\"headerlink\" href=\"#details-of-each-level-annotation\" title=\"Permalink to this heading\">#</a></h2><p>In this section, we explain the details of each level annotation.\nYou can explore the marker genes of each cluster in the <a class=\"reference external\" href=\"https://zyflab.shinyapps.io/tooth/\">shiny app</a>.</p>", "a[href=\"Level1_anno_epi.html#motivation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Motivation<a class=\"headerlink\" href=\"#motivation\" title=\"Permalink to this heading\">#</a></h2><p>In level 1 annotation, we devided the epithelium into two major clusters and other low quality clusters. Base on ameloblast markers, these two clusters can be annotated as ameloblasts, Non-ameloblasts.</p>", "a[href=\"Level2_anno_epi.html#stellate-reticulum\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Stellate reticulum<a class=\"headerlink\" href=\"#stellate-reticulum\" title=\"Permalink to this heading\">#</a></h2><p>C12-3 expressed the SR markers (<em>Vatl1</em>, <em>Fam19a4</em>) <span id=\"id2\">[<a class=\"reference internal\" href=\"../references.html#id8\" title=\"Jan Krivanek, Ruslan A. Soldatov, Maria Eleni Kastriti, Tatiana Chontorotzea, Anna Nele Herdina, Julian Petersen, Bara Szarowska, Marie Landova, Veronika Kovar Matejova, Lydie Izakovicova Holla, Ulrike Kuchler, Ivana Vidovic Zdrilic, Anushree Vijaykumar, Anamaria Balic, Pauline Marangoni, Ophir D. Klein, Vitor C. M. Neves, Val Yianni, Paul T. Sharpe, Tibor Harkany, Brian D. Metscher, Marc Baj\u00e9noff, Mina Mina, Kaj Fried, Peter V. Kharchenko, and Igor Adameyko. Dental cell type atlas reveals stem and differentiated cell types in mouse and human teeth. Nature Communications, 11(1):4816, September 2020. doi:10.1038/s41467-020-18512-7.\">Krivanek <em>et al.</em>, 2020</a>]</span>.</p><p><img alt=\"png\" src=\"../_images/C12-3.png\"/></p>", "a[href=\"Level1_anno_epi.html#low-quality-clusters\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Low quality clusters<a class=\"headerlink\" href=\"#low-quality-clusters\" title=\"Permalink to this heading\">#</a></h2><p>C5-2, C5-4 samples are too homogeneous. And C5-5 subcluster is too small (located in the middle of the far right side of the figure)</p><p><img alt=\"png\" src=\"../_images/C5-project.png\"/></p>", "a[href=\"Level2_anno_epi.html#pre-ameloblast\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pre-ameloblast<a class=\"headerlink\" href=\"#pre-ameloblast\" title=\"Permalink to this heading\">#</a></h2><p>Pre-ameloblast markers (<em>Col22a1</em>, <em>Vwde</em>, <em>Kif5c</em> <span id=\"id3\">[<a class=\"reference internal\" href=\"../references.html#id8\" title=\"Jan Krivanek, Ruslan A. Soldatov, Maria Eleni Kastriti, Tatiana Chontorotzea, Anna Nele Herdina, Julian Petersen, Bara Szarowska, Marie Landova, Veronika Kovar Matejova, Lydie Izakovicova Holla, Ulrike Kuchler, Ivana Vidovic Zdrilic, Anushree Vijaykumar, Anamaria Balic, Pauline Marangoni, Ophir D. Klein, Vitor C. M. Neves, Val Yianni, Paul T. Sharpe, Tibor Harkany, Brian D. Metscher, Marc Baj\u00e9noff, Mina Mina, Kaj Fried, Peter V. Kharchenko, and Igor Adameyko. Dental cell type atlas reveals stem and differentiated cell types in mouse and human teeth. Nature Communications, 11(1):4816, September 2020. doi:10.1038/s41467-020-18512-7.\">Krivanek <em>et al.</em>, 2020</a>]</span>) are expressed in this cluster.\n<img alt=\"png\" src=\"../_images/C12-5.png\"/></p>", "a[href=\"Level2_anno_epi.html#dental-epithelial-progenitors\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Dental Epithelial Progenitors<a class=\"headerlink\" href=\"#dental-epithelial-progenitors\" title=\"Permalink to this heading\">#</a></h2><p>This cluster is annotated base on the time point, mainly E12.5-E15.5, with high development potential\n<img alt=\"png\" src=\"../_images/C12-1.png\"/></p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`div.content ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
